import 'antd/dist/antd.css';
import './App.css';
import { Link } from "react-router-dom";

function App() {   
  return (
    <div className="App">
      <header className="App-header"/>     
      <div className="enter">         
        <nav>                    
          <Link to="/anketa?anketa=1">Анкета при трудоустройстве в СЗ</Link>
          <Link to="/anketa?anketa=2">Анкета при подключении врача из клиники партнера</Link>
          <Link to="/anketa?anketa=3">Анкета при подключении врача из регионального МО (для РГС)</Link>          
          <Link to="/signToprof">Изменить анкетные данные</Link>          
        </nav>
      </div>     
    </div>
  );
}
export default App;
